import {Heading} from "@chakra-ui/react";

function UpcomingMatches(){
    return (
        <Heading bg='#030303' color='#7b7b7b' textAlign='center' mt='50px'>
            Upcoming Matches
        </Heading>
    )
}

export default UpcomingMatches;
